const MAP_TILE_DIRECTORY = "http://localhost:9000/RoverMap/UofC/{z}/{x}/{y}.png";
const MAP_CENTER = { lat: 51.077208, lng: -114.145478 }; // U of C
//const MAP_CENTER = { lat: 51.465922, lng: -112.691409 }; // Drumheller

export const launchConsts = {
  mapTileDirectory: MAP_TILE_DIRECTORY,
  mapCenter: MAP_CENTER,
};
